const RadyDzielnicy = () => {
  const dzielnice = [
    'Bemowo',
    'Białołęka',
    'Bielany',
    'Mokotów',
    'Ochota',
    'Praga-Południe',
    'Praga-Północ',
    'Rembertów',
    'Śródmieście',
    'Targówek',
    'Ursus',
    'Ursynów',
    'Wawer',
    'Wesoła',
    'Wilanów',
    'Włochy',
    'Wola',
    'Żoliborz'
  ];

  return (
    <Container>
      <Row>
        {dzielnice.map((dzielnica, index) => (
          <Col md={4} key={index}>
            <Link to={`/dzielnica/${dzielnica}`} className="card-link">
              <Card className="card-button">
                <Card.Body>
                  <Card.Title>{dzielnica}</Card.Title>
                </Card.Body>
              </Card>
            </Link>
          </Col>
        ))}
      </Row>
    </Container>
  );
};

export default RadyDzielnicy;
